var qns = [{"title":"I would not normally discover this movie on my own."},
            {"title":"This movie is different (e.g., in genre) from the movies I usually watch."},
            {"title":"This movie would be beyond my expected recommendation results if a recommender system suggested it to me."},
            {"title":"This movie was a pleasant and surprising discovery to me."},
            {"title":"I did not expect to find this movie and it turned out to be interesting."},
            {"title":"I would not expect this movie as a recommendation (from a personalized recommender system) but if it were suggested to me, I would consider watching it."},
            {"title":"After watching the movie, I found the movie was different from what I initially expected."}
]

export default qns;
